import "../App.css";
import React, { useState } from "react";
import "./Logreg.css";

function Login() {
  const [user, setUser] = useState({ nev: "", password: "" });

  const onChangeInput = (e) => {
    const { name, value } = e.target;
    setUser({ ...user, [name]: value });
    // console.log(user);
  };

  const getData = (e) => {
    e.preventDefault();
    const nev = document.getElementById("nev").value;
    const password = document.getElementById("password").value;
    const databody = { nev, password };
    fetch("http://localhost:5000/api/user/letolt", {
      method: "POST",
      body: JSON.stringify(databody),
      headers: {
        "Content-Type": "application/json",
      },
    }).then(res => res.json())
    .then(() =>{
      if(res === 200){
        console.log(user)
      }
      else{
        console.log
      }
    })
    
  };

  return (
    <form className="page" onSubmit={getData}>
      <img id="autolog" src={require("../kepek/log.png")} alt="auto" />
      <div className="reglog1">
        <br /> <br />
        <input
          type="text"
          id="nev"
          placeholder="felhasználónév..."
          name="nev"
          value={user.nev}
          onChange={onChangeInput}
        />
        <br />
        <br />
        <input
          type="password"
          id="password"
          placeholder="jelszó..."
          name="password"
          value={user.password}
          onChange={onChangeInput}
        />
        <br />
        <br />
        <button type="submit">Login</button>
      </div>
    </form>
  );
}
export default Login;
